import React from "react";
import "./Home.css";
function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://process.filestackapi.com/AazSisOjUQx2TZJQX0PdNz/output=compress:true,quality:70,strip:true/https://klektblog.s3.eu-west-2.amazonaws.com/Banners/New+drops/2500x503-px-dior-giveaway.jpg"
        alt=""
      />
    </div>
  );
}

export default Home;
